sys_variable_value.value:
(function execute(inputs, outputs) {

  if (inputs.status_code == 200) {
    outputs.status = 'Success';
    outputs.networks = inputs.responseBody;
  } else {
    outputs = new NSOneErrorHandler().dhcpErrorHandler(inputs, outputs);
  }
})(inputs, outputs);

